import React from "react";
import "./style.css";
import { data } from "../../utils/mock";
import { Outlet, useOutlet } from "react-router-dom";

const EmptyPlaces = () => {
  const hasOutlet = useOutlet();
  return (
    <>
     {
      hasOutlet ? (<Outlet />):(
        <div ></div>
      )
     }
    </>
  );
};

export default EmptyPlaces;
